Alle Agenturmitarbeiter, die am jährlichen Agenturhaushaltsprozess teilnehmen möchten. Bitte klicken Sie entweder auf das Symbol "Neues Konto erstellen" oder den Link "Anmelden", um Anweisungen und zusätzliche Details zu jedem Schritt des Antragsformats zu erhalten. Sobald Ihre Konten eingerichtet sind, können Sie jederzeit während des diesjährigen Budgetzyklus zurückkehren, falls Fragen auftauchen, indem Sie sich wieder in Ihr Heimkonto einloggen oder eines aus der Schnellauswahlkategorie auswählen, das Ihren Bedürfnissen am nächsten kommt.
Der Zweck des FY15 UCA ist einfach:
(i) Jährliche Ausgabenzuweisungen zu tätigen;
(ii) Eine jährliche allgemeine Betriebsausgabenobergrenzenanpassung (GFOA) bereitzustellen; und
(iii) Als Finanzierungsmechanismus für den Kauf/Umbau von Einrichtungen, die dem Universitätssystem gehören (Gebäudeentwicklungsprogramm - BDP), für das ein jährlicher Immobilienhaushalt gilt;
Darüber hinaus können Agenturen die Mittel ohne Einschränkung verwenden, da diese Beträge keine Einschränkungen darstellen.
